const selected = ref(false)
const asSelected = ref(false)

const activateAustralia = () => {
  document.getElementById('australia').classList.add('activated')
  asSelected.value = true
  document.getElementById('compare').classList.add('compare')
  setTimeout(()=> document.getElementById('compare').classList.remove('compare'),1000)
}
const compareSelected = () =>{
  if(asSelected.value){
    document.getElementById('compare').classList.add('activated')
    selected.value = true
  }
}
